import React, { useState } from 'react';
import './Header.css'; // Include your styles here

function Header() {
  const [isOpen, setIsOpen] = useState(false);
  const [isLogin, setIsLogin] = useState(true);

  const togglePopup = () => {
    setIsOpen(!isOpen);
  };

  const switchToRegister = () => {
    setIsLogin(false);
  };

  const switchToLogin = () => {
    setIsLogin(true);
  };

  return (
    <header className="header">
      <div className="register-button">
        <button onClick={togglePopup} className="register-link">Register / Login</button>
      </div>

      {isOpen && (
        <div className="popup-overlay" onClick={togglePopup}>
          <div className="popup-content" onClick={(e) => e.stopPropagation()}>
            <span className="close-popup" onClick={togglePopup}>X</span>

            {isLogin ? (
              <div>
                <h2>Hello! Welcome Back</h2>

                {/* Social login buttons */}
                <div className="social-login">
                  <button className="google-btn">Login with Google</button>
                  <button className="apple-btn">Login with Apple</button>
                </div>

                {/* Divider */}
                <div className="divider">or</div>

                {/* Login Form */}
                <form>
                  <label>Email:</label>
                  <input type="email" placeholder="Enter your email" required />
                  <label>Password:</label>
                  <input type="password" placeholder="Enter your password" required />
                  <button type="submit" className="login-btn">Login</button>
                </form>

                <p>No account? <span onClick={switchToRegister} className="toggle-link">Register here</span></p>
              </div>
            ) : (
              <div>
                <h2>Register</h2>
                <form>
                  <label>Name:</label>
                  <input type="text" placeholder="Enter your name" required />
                  <label>Email:</label>
                  <input type="email" placeholder="Enter your email" required />
                  <label>Password:</label>
                  <input type="password" placeholder="Create a password" required />
                  <button type="submit" className="login-btn">Register</button>
                </form>
                <p>Already have an account? <span onClick={switchToLogin} className="toggle-link">Login here</span></p>
              </div>
            )}
          </div>
        </div>
      )}
    </header>
  );
}

export default Header;
